class Solution:
    def numSub(self, s: str) -> int:
        MOD = 10**9 + 7
        total = 0
        
        # 連続する1の長さを直接計算
        count = 0
        for char in s:
            if char == '1':
                count += 1
            else:
                if count > 0:
                    # 長さnの連続する1からできる部分文字列数: n*(n+1)/2
                    total = (total + count * (count + 1) // 2) % MOD
                    count = 0
        
        # 最後の連続する1の処理
        if count > 0:
            total = (total + count * (count + 1) // 2) % MOD
        
        return total

    def numSub_(self, s: str) -> int:
        s_body_list = s.split('0')
        len_list = [len(s) for s in s_body_list]
        total: int = 0
        print(len_list)
        for i in len_list:
            for j in range(i + 1):
                total += j
        return total

sol = Solution()
print(f'{sol.numSub("0110111")} expect 9')
print(f'{sol.numSub("101")} expect 2')
print(f'{sol.numSub("111111")} expect 21')
print(f'{sol.numSub("")} expect 200542505')